import React from 'react';
import TopNav from './TopNav';
import CentreDisplay from './CentreDisplay';
import Footer from './Footer';
import {Routes, Route} from 'react-router-dom';

function App() {
  return (
    <div id='mainDiv'>
      <TopNav />
      <Routes>
        <Route path='/' element={<CentreDisplay />}>

        </Route>
      </Routes>
      
      <Footer />
    </div>
  );
}

export default App;
